import React, { Component } from 'react';

class VotingGrid extends Component {

    state = {count: 0, name: "undefinded"}

    constructor(props) {
        // super(props);
        this.state.count = 0;
        this.state.name = props.name;
    }

    render() {
        return (<div className="languages">
            <div className="voteCount">{this.count}</div>
            <div className="language">{this.name} <button className="voting-button">Vote for it!</button></div>

        </div>);
    }
}

export default VotingGrid;
